9. CAPACITY RELEASE PROGRAM
9.1 Purpose. This Section sets forth the specific terms and conditions applicable to Transporter's capacity release program. Unless otherwise stated in this Section 9, all times are Central Clock Time ("CCT") pursuant to NAESB WGQ Standard No. 0.3.17.
9.2 Applicability. This Section 9 is applicable to any Releasing Shipper(s), or any Replacement Shipper(s), who elects to release all or a portion of its firm capacity under Rate Schedule FS-1. Releasing Shipper(s) as defined in Section 1 of these General Terms and Conditions shall have the right to release, on a permanent or temporary basis, any portion of its firm capacity rights held under an agreement with Transporter, but only to the extent that the capacity so released is acquired by another Shipper pursuant to this Section 9. Replacement Capacity Agreements based on a volumetric reservation rate are not subject to further release.
9.3 Availability of Released Capacity. Released capacity shall be made available on a nondiscriminatory basis and shall be assigned on the basis of an open season or prearrangement in accordance with the procedures of this Section 9 and, where appropriate, the applicable NAESB WGQ Standards.
9.4 Qualification for Participation in the Capacity Release Program. Any Shipper, whether seeking to acquire capacity under bid or a prearranged release must be prequalified by Transporter prior to submitting a bid for released capacity. To be prequalified, a Shipper must satisfy Transporter's creditworthiness requirements. Notwithstanding such qualification to participate in the capacity release program, Transporter does not guarantee the payment of any outstanding amounts by a Replacement Shipper.
9.5 (a) Releases Assigned On the Basis of An Open Season. A Shipper electing to release capacity on the basis of an open season must post notice of release on Transporter's electronic bulletin board pursuant to Section 9.7 hereof. Such notice shall be posted upon receipt unless Releasing Shipper requests otherwise.
(b) Reserved
(c) Posting Requirements and Minimum Lengths of Release Open Season pursuant to NAESB WGQ Standard No. 5.3.2 (Timeline), Unless otherwise noted, all times are Central Clock Time ("CCT").
Section 9.5(c) (Continued)
For biddable releases (one (1) year or less):
(i) Offers should be tendered such that they can be posted by 9:00 a.m. on a Business Day.
(ii) Open season ends at 10:00 a.m. on the same or a subsequent Business Day. Evaluation period begins at 10:00 a.m. during which any contingencies are eliminated, determination of best bid is made, and ties are broken.
(iii) If no match is required, the evaluation period ends and the award is posted by 11:00 a.m.
(iv) Where match is required, the match is communicated by 11:00 a.m., the match response occurs by 11:30 a.m., and the award is posted by 12:00 Noon.
(v) The contract is issued within one hour of the award posting (with a new contract number, when applicable). Nomination is possible beginning at the next available nomination cycle for the effective date of the contract.
For biddable releases (more than one (1) year):
(vi) Offers should be tendered such that they can be posted by 9:00 a.m. on a Business Day.
(vii) Open season shall include no less than three 9:00 a.m. to 10:00 a.m. time periods on consecutive Business Days.
(viii) Evaluation period begins at 10:00 a.m. during which any contingencies are eliminated, determination of best bid is made, and ties are broken.
(ix) If no match is required, the evaluation period ends and the award is posted by 11:00 a.m.
(x) Where match is required, the match is communicated by 11:00 a.m., the match response occurs by 11:30 a.m., and the award is posted by 12:00 Noon.
(xi) The contract is issued within one hour of the award posting (with a new contract number, when applicable). Nomination is possible beginning at the next available nomination cycle for the effective date of the contract.
Section 9.5(c) (Continued)
For non-biddable releases:
The posting of prearranged deals that are not subject to bid are due no later than one hour prior to the nomination deadline for the applicable cycle, pursuant to NAESB WGQ Standard No. 1.3.2. The posting deadlines are: * Timely Cycle 12:00 Noon * Evening Cycle 5:00 p.m. * Intraday 1 Cycle 9:00 a.m. * Intraday 2 Cycle 1:30 p.m. * Intraday 3 Cycle 6:00 p.m. The contract is issued within one hour of the award posting (with a new contract number, when applicable). Nomination is possible beginning at the next available nomination cycle for the effective date of the contract.
NOTES: (1) Posting of Notices of Release either under an open season or a prearranged release are subject to review by Transporter for accuracy, completeness, and validity before being posted.
(2) If a Releasing Shipper agrees to accept a contingent bid pursuant to Section 9.7(n), the beginning of the open season shall start earlier by a minimum of two Business Days.
9.6 Prearranged Releases. A Shipper electing to release capacity on the basis of a prearranged release must post notice on Transporter's electronic bulletin board pursuant to Section 9.9 herein. (a) No open season is required for a prearranged release which meets all of the terms of the release and is: (1) a release for more than one Year at the maximum Reservation Rates applicable to Rate Schedule FS-1, (2) a release for any period of thirty-one Days or less, (3) a release to an asset manager as defined by FERC regulations at C.F.R. 284.8, or (4) a release to a marketer participating in a state-regulated retail access program as defined by FERC regulations at C.F.R. 284.8. All other prearranged releases shall be subject to an open season requirement contained in Section 9.5 hereof.
(b) A Releasing Shipper may not rerelease capacity that is a rollover or extension of a release of thirty-one Days or less to the same Replacement Shipper until twenty-eight (28) Days after the first release period has ended. The 28-Day hiatus does not apply to any re-release to the same Replacement Shipper that is posted for bidding or that qualifies for any of the other exemptions from bidding in this Section 9.6.
Section 9.6 (Continued) (c) A Shipper electing to release capacity on a prearranged basis not subject to an open season must post the notice of release on Transporter's electronic bulletin board pursuant to the timeline for non-biddable releases in Sections 9.5(c)(xii) - (xv) above.
9.7 Notice by Shipper Electing to Release Capacity On An Open Season Basis. Any Shipper holding capacity rights subject to this Section 9 who desires to release such firm capacity on an Open Season Basis shall deliver notice via Transporter's electronic bulletin board which shall contain the following:
(a) Releasing Shipper's legal name, contract number, and the name of the individual responsible for authorizing the release of capacity;
(b) the maximum and minimum quantity of firm daily capacity which the Releasing Shipper desires to release, stated in Dth per Day (notice should include MDWQ, MDIQ, and MAC, as defined in this Tariff);
(c) whether capacity will be released on a recallable or a recallable and reputtable (returned to the Replacement Shipper) basis. Recall and reput terms must be objectively stated, nondiscriminatory, and applicable to all bidders. The Transportation Service Provider should support the ability for the Releasing Shipper to specify, as a condition of a release, whether the Releasing Shipper's recall notification must be provided exclusively on a Business Day (NAESB WGQ Standard No. 5.3.51).
(d) the requested effective date and the term of the release (minimum term of release is one Day);
(e) whether the Releasing Shipper is willing to consider release for a shorter time period than that specified by Releasing Shipper in (d) above, and, if so, the minimum acceptable period of release;
(f) whether the Releasing Shipper desires bids for the released capacity to be stated in dollar amount per Dth or as a percentage of Transporter's maximum reservation rates as in effect from time to time, or as an index-based formula (under one of the methods listed below);
(i) a percentage of the formula (ii) a dollars and cents differential from the formula, or (iii) a dollars and cents differential from the Rate Floor;
Section 9.7 (Continued)
(g) whether the Releasing Shipper desires to release capacity on a volumetric reservation rates basis or an index-based formula. If utilizing an index-based formula, the Releasing Shipper should specify the minimum acceptable rate, and if applicable, any minimum volumetric load factor commitment. (Capacity releases made on a volumetric rate basis cannot be rereleased by the Replacement Shipper);
(h) maximum Tariff reservation rates, or an index-based formula, applicable to Rate Schedule FS-1 for which capacity being released as shown on Transporter's Statement of Rates will be posted in the notice of release by Transporter;
(i) if Releasing Shipper is willing to consider releasing capacity at less than maximum reservation rates stated in (h) above, and if so, the minimum reservation rates Releasing Shipper is willing to accept;
(j) whether the Releasing Shipper wants Transporter to market the capacity in accordance with Section 9.18 hereof;
(k) for releases posted to comply with the NAESB Timeline as shown in Section 9.5(c) hereof, the Releasing Shipper shall select one of the following bid evaluation methods and provide sufficient information and instruction and which are described more fully in Section 9.12(d): (i) Present Value (ii) Highest Rate (iii) Net Revenue
(l) in lieu of the methods described in Section 9.7(k) above, the Releasing Shipper may provide its own nondiscriminatory bid evaluation criteria; except that Transporter will not accept first bidder meeting minimum acceptable terms of the release as a valid bid evaluation method.
(m) the time and date the notice is to be posted on Transporter's electronic bulletin board. Release notice will be posted upon receipt unless otherwise requested by Releasing Shipper. Open season dates will be posted by Transporter based on the requirements of Section 9.5 of this Tariff or by Releasing Shipper, if Shipper requests an open season longer or earlier posting than required in Section 9.5 herein. After the open season has commenced, a Releasing Shipper cannot specify the extension of an open season bid period without posting a new release.
(n) whether the Releasing Shipper is willing to accept contingent bids.
Section 9.7 (Continued)
(o) Releasing Shipper shall elect one of the following:
(i) establish minimum terms of the release and display them on the electronic bulletin board;
(ii) establish minimum terms of the release and keep such terms confidential (i.e., not post them on the electronic bulletin board) but Bidding Shipper will be informed on the electronic bulletin board that minimums have been established;
(iii) establish no minimum terms; Releasing Shipper will accept highest bid received for the release.
(p) any other applicable conditions of the release.
9.8 Posting the Results of Prearranged Releases. With respect to a prearranged release which is not subject to an open season, Transporter shall post notice of completed transactions pursuant to Section 9.15 hereof of such release within two Business Days after the transaction commences.
9.9 Notice by Shipper Electing to Release Capacity on Prearranged Release Basis and Confirmation of Bid by Prearranged Shipper. The Releasing Shipper shall deliver a notice of a prearranged release via Transporter's electronic bulletin board. Likewise, the prearranged Shipper must confirm its bid electronically on the electronic bulletin board. The electronic bulletin board notice shall set forth the following information:
(a) all the items contained in Section 9.7 hereof required to define a prearranged release;
(b) prearranged Shipper's legal name and the name and telephone number of the individual responsible for authorizing the bid for the prearranged release;
(c) the term of the proposed acquisition of capacity by prearranged Shipper (minimum term of any release is one Day);
(d) the reservation rates, expressed as a daily rate or as a percentage of the maximum reservation rates, or as an index-based formula, as appropriate, the prearranged Shipper has agreed to pay for the released capacity and any minimum volumetric load factor, if applicable. If capacity is released on a volumetric rate basis, it cannot be rereleased by the Replacement Shipper;
(e) the capacity (MDWQ, MDIQ, and MAC) which prearranged Shipper wishes to acquire stated in Dth;
Section 9.9 (Continued)
(f) whether or not the prearranged Shipper is an affiliate of Releasing Shipper or an affiliate of Transporter;
(g) whether or not the prearranged Shipper is an asset manager or a marketer participating in a state-regulated retail access program, as defined by FERC regulations at 18.C.F.R. 284.8;
(h) the time and date the notice is to be posted on Transporter's electronic bulletin board. Release notice will be posted upon receipt unless otherwise requested by Releasing Shipper. Open season dates will be posted by Transporter based on the requirements of Section 9.5 of this Tariff, if applicable, or by Releasing Shipper, if Releasing Shipper requests a longer open season than the minimum required in Section 9.5. Releasing Shipper cannot allow extension of time provided for the prearranged Shipper to match a higher bid (matching period as described in the Timelines in Section 9.5 hereof) without posting a new release;
(i) any other applicable conditions of the prearranged release.
9.10 Term of Released Capacity. The term of any release of firm capacity shall not exceed the term of the Storage Service agreement or Replacement Capacity Agreement under which the release occurs, nor shall it be less than one Day.
9.11 Bids for Released Capacity Subject to Open Season. A bid may be submitted to Transporter by a Bidding Shipper at any time during the open season via Transporter's electronic bulletin board. The Bidding Shipper (or prearranged Shipper) must have met the creditworthiness provisions of Transporter's Tariff pursuant to Section 9.4 hereof.
(a) Each bid for released capacity must include the following:
(i) Bidding Shipper's legal name and the name and telephone number of the individual responsible for authorizing the bid;
(ii) the term of the proposed acquisition;
(iii) the maximum reservation rates expressed as a daily rate or percentage of the maximum reservation rates, as appropriate, or as an index-based rate, or maximum volumetric rate (either dollars or percent, as appropriate) Bidding Shipper is willing to pay for the released capacity;
(iv) the capacity desired, including MDWQ, MDIQ, and MAC, as defined herein;
(v) whether or not the Bidding Shipper is an affiliate of the Releasing Shipper or an affiliate of Transporter;
(vi) for prearranged releases, whether or not the Bidding Shipper is an asset manager or a marketer participating in a state-regulated retail access program, as defined by FERC regulations at 18 C.F.R. 284.8;
(vii) any other information requested in notice of release posted on Transporter's electronic bulletin board;
(viii) whether or not Bidding Shipper will meet all other terms of release (if there are any); and
(ix) the time and date the bid was submitted to Transporter for posting on Transporter's electronic bulletin board.
(b) All valid and complete bid(s) received by Transporter during the open season as detailed in Section 9.5 hereof shall be posted on Transporter's electronic bulletin board. The identity of the Bidding Shipper(s) will not be posted, but all other terms of the bid(s) will be posted on Transporter's electronic bulletin board.
Section 9.11 (Continued)
(c) Except as stated in this Section 9.11(c), a Bidding Shipper may not bid a reservation rate less than the minimum Tariff Reservation Rates nor more than the maximum Tariff Reservation Rates or index-based release formula, nor may the capacity or the term of the release of such bid exceed the maximum quantity or term specified by Releasing Shipper. No maximum rate limitation applies to a release of capacity for a period of one year or less if the release is to take effect on or before one year from the date on which Transporter is notified of the release.
(d) A Bidding Shipper may withdraw its bid any time prior to the expiration of the open season but may not resubmit a bid for the same release at an equal or lower rate. Bids shall be binding until notice of withdraw is received by Transporter on its Customer Activities Web site.
(e) A Bidding Shipper may only have one bid pending for a particular capacity release transaction at any one time.
(f) All bids pending at the expiration of the open season shall be binding upon Bidding Shipper(s). Further, the Bidding Shipper(s) agrees that its bid will constitute a binding agreement if the Bidding Shipper is awarded the released capacity pursuant to this Section 9.
9.12 Awarding of Released Capacity. Released capacity shall be awarded in accordance with this Section 9.12.
(a) If a Bidding Shipper's bid satisfies all terms and conditions specified in the Releasing Shipper's notice, including the posted Reservation Rates, then the capacity shall be awarded to such Bidding Shipper, and the Releasing Shipper shall not be entitled to reject such bid. If such bid was submitted in an open season relating to a prearranged release, capacity shall be awarded pursuant to Section 9.12(h) hereof.
(b) Releasing Shipper(s) may withdraw their offer of release any time prior to the start of the open season or during the open season in the event of an unexpected change in the Releasing Shipper's need for the capacity being released up to the time a valid bid is received. The Releasing Shipper may not withdraw its offer of release, however, if bids have been received that meet the minimum terms of the release; the Releasing Shipper may withdraw its offer to release capacity by notifying Transporter on its Customer Activities Web site.
Section 9.12 (Continued)
(c) If more than one bid is received that is equal to or exceeds all the minimum terms and conditions specified in Releasing Shipper's notice, then Replacement Shipper(s) shall be the Bidding Shipper(s) who offer(s) the highest bid, based on the bid evaluation methods as posted by Releasing Shipper in its notice of release. Transporter shall evaluate and rank all bids submitted during the open season. If bids from two or more Bidding Shippers result in bids of equal value, then the capacity shall be awarded pursuant to Section 9.12(g) hereof. If Bidding Shipper has made a bid based on a contingency and such contingency has not been removed by the date and time specified by Releasing Shipper or pursuant to the Timelines in Section 9.5 hereof, such bid shall be deemed withdrawn.
(d) Bid Evaluation Methods. All bids received will be evaluated pursuant to the following methods:
(i) Present Value Calculation. Releasing Shipper may elect to have all bids evaluated and ranked pursuant to a Present Value Calculation as follows:
1 - (1 + i)^-n R x -------------- x V = present value i where: i = interest rate per Month using one-twelfth (1/12) the current FERC annual interest rate defined in Section 154.501(d) of FERC's regulations n = term of the release R = the reservation rates bid V = Quantity stated in Dth
(ii) Highest Rate. Releasing Shipper may elect to have bids evaluated on the basis of the highest reservation rates bid;
(iii) Net Revenue. Releasing Shipper may elect to have bids evaluated on the basis of the total reservation rates-based revenues received over the term of the release;
(iv) Other Method. Releasing Shipper may at the time of posting of the notice of release specify how bids are to be evaluated to determine which offer is the best. The criteria must be objectively stated, applicable to all potential bidders, and nondiscriminatory. It can contain provisions that allow for weighting of factors such as quantity, term, and rate; however, Transporter will not accept first bidder meeting minimum acceptable terms of the release as a valid bid evaluation methodology. If bid evaluation criteria is provided by the Releasing Shipper and varies from Section 9.7(k) hereof, the evaluation period specified in Section 9.5(c) shall be extended by on Business Day. Section 9.12 (Continued)
(e) If bid evaluation criteria are provided by Releasing Shipper, Transporter shall, for each bid received, calculate the total value of all the bids received at the end of the open season based on the nondiscriminatory criteria provided by Releasing Shipper. The results of this calculation shall determine each bid's actual total value. The bids will then be ranked by Transporter in order from the highest to the lowest total value.
(f) For bids evaluated using any of the first three methods (Sections 9.12(d)(i) through (iii), above), Transporter shall notify Releasing Shipper and successful bidder no later than 5:00 p.m. CCT on the Day before Nominations are due (as specified in Section 9.5, hereof) and the capacity shall be awarded to the successful Bidding Shipper(s) (i.e., the Replacement Shipper(s)).
(g) If bids from two or more Bidding Shippers result in bids of the highest equal value, the first bid received of highest equal value will be awarded the capacity.
In the case where valid bids for less than the full release quantity have been received, Transporter shall, where appropriate, award all valid bids until all offered capacity has been awarded.
(h) With respect to a prearranged release, if no better offer (as determined above) is received during an open season or the prearranged offer is for the applicable maximum reservation rate(s) under the applicable rate schedule for a term of more than one year and meets all the other terms of the release, then the prearranged Shipper shall become the Replacement Shipper for the released capacity. If a better offer is received during the open season, the prearranged Shipper shall have the time specified in Section 9.5 hereof to match that offer. If the prearranged Shipper fails to match the better offer, then the Bidding Shipper who presented the better offer, as determined above, shall become the Replacement Shipper.
(i) For index-based capacity release transactions, the Releasing Shipper should provide the necessary information and instructions to support the chosen methodology. If the Releasing Shipper specifies an index-based formula in its capacity release offer, the Bid Rate (R) used in the bid evaluation options of this Section 9.12 will be based on: 1) the dollars differential or percentage of the Rate Default or 2) the dollars differential of the Rate Floor, as applicable.
(j) A Releasing Shipper shall retain all of the capacity under the executed Storage Service agreement or Replacement Capacity Agreement that is not acquired by a Replacement Shipper as the result of an open season or a prearranged release.
(k) If no bids are received which meet or exceed all of the minimum conditions specified by Releasing Shipper, no capacity shall be awarded.
9.13 Recalls and Reputs of Capacity. If capacity is released subject to recall pursuant to Section 9.7(c), in addition to such other terms not inconsistent with this Section as are agreed to by the Releasing Shipper and the Replacement Shipper, recall of such capacity shall be subject to the following terms and conditions:
(a) All Transportation Service Providers ("TSPs") should support the following recall notification periods for all released capacity subject to recall rights: (NAESB WGQ Standard No. 5.3.44)
(i) Timely Recall Notification:
(A) A Releasing Shipper recalling capacity should provide notice of such recall to the TSP and the first Replacement Shipper no later than 8:00 a.m. on the day that Timely Nominations are due;
(B) The TSP should provide notification of such recall to all affected Replacement Shippers no later than 9:00 a.m. on the day that Timely Nominations are due;
(ii) Early Evening Recall Notification:
(A) A Releasing Shipper recalling capacity should provide notice of such recall to the TSP and the first Replacement Shipper no later than 3:00 p.m. on the day that Evening Nominations are due;
(B) The TSP should provide notification of such recall to all affected Replacement Shippers no later than 4:00 p.m. on the day that Evening Nominations are due;
(iii) Evening Recall Notification:
(A) A Releasing Shipper recalling capacity should provide notice of such recall to the TSP and the first Replacement Shipper no later than 5:00 p.m. on the day that Evening Nominations are due;
(B) The TSP should provide notification of such recall to all affected Replacement Shippers no later than 6:00 p.m. on the day that Evening Nominations are due;
Section 9.13(a) (Continued)
(iv) Intraday 1 Recall Notification:
(A) A Releasing Shipper recalling capacity should provide notice of such recall to the TSP and the first Replacement Shipper no later than 7:00 a.m. on the day that Intraday 1 Nominations are due;
(B) The TSP should provide notification of such recall to all affected Replacement Shippers no later than 8:00 a.m. on the day that Intraday 1 Nominations are due ;
(v) Intraday 2 Recall Notification:
(A) A Releasing Shipper recalling capacity should provide notice of such recall to the TSP and the first Replacement Shipper no later than 12:00 p.m. on the day that Intraday 2 Nominations are due;
(B) The TSP should provide notification of such recall to all affected Replacement Shippers no later than 1:00 p.m. on the day that Intraday 2 Nominations are due.
(v) Intraday 3 Recall Notification:
(A) A Releasing Shipper recalling capacity should provide notice of such recall to the TSP and the first Replacement Shipper no later than 4:00 p.m. on the day that Intraday 3 Nominations are due;
(B) The TSP should provide notification of such recall to all affected Replacement Shippers no later than 5:00 p.m. on the day that Intraday 3 Nominations are due.
(b) For recall notification provided to the Transportation Service Provider ("TSP") prior to the recall notification deadline specified in NAESB WGQ Standard No. 5.3.44 and received between 7:00 a.m. and 5:00 p.m., the TSP should provide notification to all affected Replacement Shippers no later than one hour after receipt of such recall notification.
For recall notification provided to the TSP after 5:00 p.m. and prior to 7:00 a.m., the TSP should provide notification to all affected Replacement Shippers no later than 8:00 a.m. after receipt of such recall notification. (NAESB WGQ Standard No. 5.3.45)
(c) Releasing Shipper's notice of recall and reput must be submitted using the Transporter's on-line capacity release system. Section 9.13 (Continued)
(d) The recall notice shall also state the length of the recall period and state the conditions of any reput rights of the Releasing Shipper and reput obligations of the Replacement Shipper as may have been negotiated at the time of the release (see Section 9.7(c), hereof). Unless otherwise agreed to by Releasing Shipper and Replacement Shipper, and Transporter is so advised, the Replacement Shipper will regain the capacity at the end of the recall period.
(e) In the event of an intraday capacity recall, the Transportation Service Provider ("TSP") should determine the allocation of capacity between the Releasing Shipper and the Replacement Shipper(s) based upon the Elapsed Prorata Capacity ("EPC"). Variations to the use of EPC may be necessary to reflect the nature of the TSP's tariff, services, and/or operational characteristics. (NAESB WGQ Standard No. 5.3.56)
(f) Unless otherwise agreed between Releasing Shipper, Replacement Shipper and Transporter, the Releasing Shipper must notify Transporter and Replacement Shipper of the intent to reput the capacity back to the Replacement Shipper. The deadline for notifying the Transportation Service Provider of a reput is 8:00 a.m. to allow for timely nominations to flow on the next gas day (NAESB WGQ Standard No. 5.3.54). When capacity is recalled, it may not be reput for the same gas day (NAESB WGQ Standard No. 5.3.53).
(g) Transporter shall not assess penalties during non-critical periods on transactions related to quantities recalled during an Intraday scheduling cycle.
9.14 Execution of Agreements or Amendments.
(a) The successful bidder (or successful prearranged Shipper) for capacity shall become the Replacement Shipper and its bid for capacity, or the posting of prearranged release pursuant to Sections 9.9 and 9.11 shall be binding. The bid submitted by the Replacement Shipper, as supplemented by the posting of capacity release on Transporter's electronic bulletin board, shall constitute the Replacement Capacity agreement and the corresponding amendment to Releasing Shipper's Agreement. For all releases, Replacement Shipper(s) will gain rights to nominate firm capacity for injection and withdrawal quantities consistent with quantities, and for the term as specified in the release notice, and subject to all other terms of the underlying agreement. The Releasing Shipper(s) will lose its firm entitlement rights to Nominate consistent with the same terms.
(b) Where capacity has been released for the entire remaining term of the Releasing Shipper's Storage Service agreement, at rates equal to or greater than the rates in the Releasing Shipper's Storage Service agreement, the Releasing Shipper's Storage Service agreement shall be terminated.
9.15 Notice of Completed Transactions. Within two Business Days after capacity has been released pursuant to Section 9.12, Transporter shall post a Notice of Completed Transaction on its electronic bulletin board for a minimum period of five Days. The notice shall include the following information regarding each transaction:
(a) the name(s) of Releasing Shipper and Replacement Shipper (or prearranged Shipper);
(b) term of release;
(c) Reservation Rate as bid;
(d) capacity (MDWQ, MDIQ, and MAC) in Dth, as appropriate;
(e) whether the capacity is recallable and reputtable, and if so, the recall and reput terms;
(f) whether or not the Replacement Shipper is an affiliate of Releasing Shipper, or an affiliate of Transporter. Except for prearranged release(s) as described in Section 9.6 of the General Terms and Conditions, service may begin for the release on the initial date of the term of the release if Nominations are made timely to Transporter and are in accordance with this Tariff; and
(g) whether or not the prearranged Shipper is an asset manager or a marketer participating in a state-regulated retail access program, as defined by FERC regulations at 18 C.F.R. 284.8.
9.16 Effective Date of Release and Acquisition. The effective date of the release by a Releasing Shipper and acquisition by a Replacement Shipper shall be on the date so designated in the Replacement Capacity Agreement (posted term effective date) or Storage Service agreement referenced above.
9.17 Rates.
(a) The reservation rates for any released firm capacity shall be the reservation rates bid by Replacement Shipper. Such rate shall not be less than Transporter's minimum or more than Transporter's maximum reservation rates in effect from time to time, except as noted in Section 9.11(c) of the GT&C.
(b) Replacement Shipper shall pay the applicable maximum Quantity Injection Rate and Quantity Withdrawal Rate in addition to all other applicable charges and surcharge(s) for the service rendered unless otherwise agreed by Transporter.
Section 9.17 (Continued)
(c) For a release based on a volumetric reservation rate, maximum and minimum reservation rates will be equal to the authorized overrun rates for Rate Schedule FS-1 as shown on the Statement of Rates.
(d) The reservation charge(s) and reservation surcharge(s) for any index-based capacity release shall be determined according to NAESB WGQ Standard No. 5.3.67.
9.18 Marketing Fee. A Releasing Shipper may request that Transporter actively market the capacity to be released. In such event, the Releasing Shipper and Transporter shall negotiate the terms of the marketing service to be provided by Transporter and the marketing fee to be charged therefor.
9.19 Billing. Transporter shall bill Replacement Shipper the rate(s) specified in the Replacement Capacity Agreement and any other applicable charges, and surcharges, and Replacement Shipper shall pay the billed amounts directly to Transporter. The Releasing Shipper shall be billed the reservation charge associated with the entire amount of released capacity pursuant to its contract rate. The Releasing Shipper shall also be billed a marketing fee, if applicable, pursuant to the provisions of Section 9.18 above. A Replacement Shipper who rereleases acquired capacity shall pay to Transporter a marketing fee, if applicable. Transporter will credit reservation charges to the Releasing Shipper at the same time as the Replacement Shipper is billed. Transporter will notify Releasing Shipper if Replacement Shipper fails to pay amounts due pursuant to the terms of Replacement Shipper's agreement. If a Replacement Shipper does not make payment to Transporter of any portion of the reservation charge(s) (including reservation surcharge(s)) due Transporter for service under the applicable Replacement Capacity Agreement when such amount is due, Releasing Shipper may terminate the release and the capacity released reverts to Releasing Shipper.
9.20 Nominations. All Nominations submitted by a Replacement Shipper must be in compliance with the provisions of the applicable Agreement under which service is being provided.
9.21 Compliance by Replacement Shipper. By acquiring released capacity, a Replacement Shipper agrees that it will comply with the terms and conditions of Transporter's certificate of public convenience and necessity authorizing this Capacity Release Program and all applicable FERC orders and regulations. Such Replacement Shipper also agrees to be responsible to Transporter for compliance with all terms and conditions of Transporter's Tariff, as well as the terms and conditions of the Replacement Capacity Agreement.
9.22 Obligations of Releasing Shipper. Releasing Shipper shall continue to be liable and responsible for all Storage Capacity and reservation charge(s) (including reservation surcharge(s)) associated with the released capacity up to the maximum Storage Capacity and reservation charge(s) specified in such Releasing Shipper's Storage Service agreement or Replacement Capacity Agreement. Rereleases by a Replacement Shipper shall not relieve the original or any subsequent Releasing Shipper of its obligations under this Section.
9.23 Refunds. In the event that the FERC orders refunds of any rate(s) charged by Transporter, Transporter shall flow-through refunds to any Replacement Shipper to the extent such Shipper has paid a rate in excess of Transporter's applicable maximum rate(s). For releases that become effective on or after July 30, 2008, the rate paid by a Replacement Shipper in any capacity release transaction with a term of one Year or less which is not subject to the maximum rate limitation will be deemed to be a final rate and is not subject to refund.
9.24 Advertisements. Any person may advertise for the purchase of capacity on Transporter's system on its EBB by submitting the desired advertisement (up to one page) to Transporter. Transporter shall post such advertisement on the Informational Postings portion of its EBB no later than the Business Day following receipt thereof if so requested, so long as the advertisement is not unlawful or inconsistent with Transporter's Tariff. The posted period requested may be for a period of time not to exceed one month. There will be no posting fee for such advertisements seeking to purchase capacity on Transporter's system. A response in and of itself to an advertisement seeking to purchase capacity never constitutes a capacity release. To release capacity, the Shipper holding the capacity rights must utilize the release procedures set forth in Section 9 of these General Terms and Conditions.
